  summary: Represents a collection of binding parameters that store information used by binding elements to build factories.
  remarks: "The [BindingParameterCollection](xref:CoreWCF.Channels.BindingParameterCollection) is a collection of objects that is used when a custom binding needs to provide additional parameters to another binding. For example, the <xref:CoreWCF.Channels.SecurityBindingElement> looks for <xref:System.ServiceModel.Description.ServiceSecurityAuditBehavior> in the <xref:CoreWCF.Channels.BindingParameterCollection> to determine Security auditing settings.  \n\n"
